<!DOCTYPE html>
<html lang="{{ str_replace('_', '-', app()->getLocale()) }}">
    <head>
        <meta charset="utf-8">
        <meta name="viewport" content="width=device-width, initial-scale=1">

        <title>Carte OpenStreetMap avec Laravel</title>

        <!-- Fonts (conservÃ© de votre code original) -->
        <link rel="preconnect" href="https://fonts.bunny.net">
        <link href="https://fonts.bunny.net/css?family=figtree:400,600&display=swap" rel="stylesheet" />
        
        <!-- 1. Leaflet CSS (Obligatoire pour le style de la carte) -->
        <link rel="stylesheet" href="https://unpkg.com/leaflet@1.9.4/dist/leaflet.css"
              xintegrity="sha512->
      />
    </head>
    <body class="antialiased">
    <style>
    #mapid { 
        height: 500px; 
        width: 100%; 
        /* DÃ©finir une hauteur et largeur est obligatoire */
    }
</style>
<div id="mapid"></div>
<script>
    // 1. DÃ©finir les coordonnÃ©es du centre (exemple : Lyon, France)
    const centreCoordinates = [45.75, 4.85]; // [latitude, longitude]
    const initialZoom = 13;

    // 2. Initialiser la carte Leaflet et la lier au conteneur #mapid
    const map = L.map('mapid').setView(centreCoordinates, initialZoom);

    // 3. Ajouter les tuiles d'OpenStreetMap (le fond de carte)
    // C'est cette URL qui connecte Leaflet Ã  OSM
    L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
        attribution: '&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
    }).addTo(map);

    // 4. Ajouter un marqueur (Optionnel)
    const marker = L.marker(centreCoordinates).addTo(map)
        .bindPopup('<b>Bonjour !</b><br>Vous Ãªtes ici.')
        .openPopup();
</script>
    </body>
</html>
